insert  into `catalog_product_entity_text`(`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (1202,10,104,0,230,NULL),(1203,10,97,0,230,'*Shatavari plant contains the triterpene saponins called Shatavarin I-IV, which support the body\'s own natural production of estrogen.\r\n•	Supports fertility and vitality\r\n•	Promotes Lactation (breast milk)\r\n•	Relieve menstrual pain and control heavy blood loss during \r\n	menstruation.\r\n•	Acts as a Rejuvenator\r\n'),(1204,10,506,0,230,'Asparagus racemosos\r\nSaponins> 20% \r\n60 Veg Capsues\r\nHerbal Supplement\r\nFor Women’s Health\r\n•	Promotes lactation \r\n•	Enhances fertility \r\n•	Regulates menstrual cycle\r\n'),(1205,10,531,0,230,NULL),(1212,10,104,0,231,NULL),(1213,10,97,0,231,'Kapikachu is also known as velvet bean. The seeds have L-dopa, which is a neurotransmitter precursor and an effective drug for treating in Parkinson\'s Disease. \r\n•	increases sperm count\r\n•	Increases libido effectively in both men and women\r\n•	normalises nerve cell function \r\n'),(1214,10,506,0,231,'Mucuna pruriens \r\n60 Veg Capsues \r\nHerbal Supplement\r\n L-Dopa- 8% \r\nFor Men’s Health\r\n•	normalises nerve cell function \r\n•	aphrodisiac (increases testosterone levels)\r\n•	increases sperm count\r\n'),(1215,10,531,0,231,NULL),(1230,10,104,0,232,NULL),(1231,10,97,0,232,'In Ayurveda, Guduchi is considered one of the most divine herbs. The stem contains alkaloidal constituents, including berberine and bitter principals \r\n•	It builds body’s resistance to infections\r\n•	Enhances the activity of white blood cells\r\n•	Also helps in skin conditions such as psoriasis and eczema\r\n•	It removes free radicals and helps delay aging\r\n•	Protects Liver\r\n•	Useful in jointache\r\n'),(1232,10,506,0,232,'Tinospora cordifolia,\r\nBitters > 2%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nFor immune function\r\n•	Fights Infections\r\n•	Builds resistance\r\n'),(1233,10,531,0,232,NULL),(1246,10,104,0,233,NULL),(1247,10,97,0,233,'Tribulus terrestris is also known in Sanskrit as Gokshura. It is believed to contribute to overall physical, as well as sexual, strength by building all the tissues. It is believed to be useful act as a diuretic also.\r\nThe extract is claimed to increase the body\'s natural testosterone levels and thereby improve male sexual performance and help build muscle\r\n•	Useful in erectile dysfunction\r\n•	Useful in male infertility, oligospermia\r\n•	It increases fertility and can rejuvenate the body\r\n•	It may increase libido/ sexual desire in both men and women \r\n'),(1248,10,506,0,233,'Gokhru or gokshura\r\n Saponins > 20% \r\n60 Veg Capsues \r\nHerbal Supplement\r\nFor sexual health\r\n•	Increases Physical performance\r\n•	Increases desire\r\n'),(1249,10,531,0,233,NULL),(1260,10,104,0,234,NULL),(1261,10,97,0,234,'Tulasi also known as  holy basil, or  Tulsi ,  is cultivated for religious and medicinal purposes, and for its essential oil. it is regarded in Ayurveda as a kind of \"elixir of life\" and believed to promote longevity. \r\ntulasi is taken in many forms: as herbal tea, dried powder, fresh leaf or mixed with ghee.\r\n•	Relieves stress\r\n•	natural rich antioxidant\r\n•	It has anti-microbial & anti-inflammatory properties\r\n•	It is useful in dry & wet cough, cold, sore throat, etc\r\n'),(1262,10,506,0,234,'(Tulsi / OCIMUM SANCTUM)\r\nTannins > 5%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nRelieves cough & Cold\r\n•	effective in  Respiratory disorders\r\n'),(1263,10,531,0,234,NULL),(1278,10,104,0,235,NULL),(1279,10,97,0,235,'Bacopa is an important medicinal herb used in Ayurveda, where it is also known as \"Brahmi. It has traditionally been employed as a neurological tonic. A class herb taken to sharpen intellect and reduce mental deficits. The herb was allegedly used by ancient Vedic scholars to memorize lengthy sacred hymns and scriptures\r\n•	It Helps to improve mental alertness\r\n•	It Helps to protect the brain from ill effects of stress\r\n•	It improves memory\r\n•	It reduces anxiety and restlessness. '),(1280,10,506,0,235,'Bacosides > 15%\r\n(BACOPA MONNIERI)\r\n60 Veg Capsues \r\nHerbal Supplement\r\nPromotes Brain Function\r\n•	Helps Improves mental ability\r\n•	Enhances learning performance'),(1281,10,531,0,235,NULL),(1296,10,104,0,236,NULL),(1297,10,97,0,236,'An very popular Ayurvedic herbal formula,Triphala(Terminalia chebula,Terminalia bellirica and Emblica officinalis) is an effective bowel cleanser. Triphala relieves constipation and regularizes the digestive system, without disrupting the fluid-electrolyte balance in the body.\r\n•	It is a laxative, useful in constipation, gas, and regularizes intestinal movement.\r\n•	It improves digestion  \r\n•	It acts as a Rasayan and very good for blood circulation.\r\n'),(1298,10,506,0,236,' (A combination of Haritaki, Bibhitaki & Amalaki)\r\n60 Veg Capsues \r\nHerbal Supplement\r\nFor Bowel Care \r\n•	Useful in constipation.\r\n•	Supports digestion\r\n'),(1299,10,531,0,236,NULL),(1310,10,104,0,237,NULL),(1311,10,97,0,237,'Garcinia Cambogia (Vrikshamla) grows in India the evergreen forests of the Western Ghats, the Southern Konkan region and in Goa. The active constituent in this herb, HCA, helps weight loss by promoting normal appetite levels and by reducing the body’s ability to form adipose (fatty) tissue. HCA also reduces blood lipid levels and naturally lowers cholesterol.\r\n•	It aids fat metabolism.\r\n•	Helps maintain healthy lipid levels\r\n•	It Supports normal appetite.\r\n•	Useful for weight management.\r\nDosage : 1 capsule twice a day before meals or as directed by your physician\r\n'),(1312,10,506,0,237,'Vrikshamla\r\n HCA > 60%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nFor Weight Loss\r\n•	supports normal fat and carbohydrate metabolism\r\n•	Maintains healthy appetite level and optimum body weight.\r\n•	>60% HCA FOR MAXIMUM RESULTS\r\n'),(1313,10,531,0,237,NULL),(1324,10,104,0,238,NULL),(1325,10,97,0,238,'For over 3,000 years, ashwagandha has been to promote overall wellness. In Ayurvedic literature Ashwagandha has been described as herb used for providing calming, antistress & rejuvenating effects. \r\n•	It relieves stress & promotes sound sleep\r\n•	In the prevention and treatment of many stress-related diseases like arteriosclerosis, arthritis, diabetes, hypertension\r\n•	 It is a powerful antioxidant which scavenges free radicals in cells that are responsible for premature aging.\r\n•	Supports a healthy immune system\r\n•	Ashwagandha is a powerful aphrodisiac\r\n'),(1326,10,506,0,238,'(WITHANIA SOMNIFERA) \r\n60 Veg Capsues \r\nHerbal Supplement\r\nWithanolides 2.5%\r\nRelieves Stress\r\n•	Powerful Anti oxidant\r\n•	Promotes sound sleep'),(1327,10,531,0,238,NULL),(1342,10,104,0,239,NULL),(1343,10,97,0,239,'Shilajit is a Sanskrit word meaning \"rock-invincible”.  It has been reported to contain at least 85 minerals in ionic form, as well as triterpenes, humic acid and fulvic acid\r\n\r\n•	It Control Blood Pressure, Purifies Blood.\r\n•	It supports immune system.\r\n•	It is helpful in increasing blood circulation\r\n•	It optimizes physical performance.\r\n•	It enhances rehabilitation of muscle, bones and nerves.\r\n'),(1344,10,506,0,239,'Asphaltum Punjabianum\r\n Fulvic Acid > 3%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nBuilds Immunity \r\n•	Boosts Performance\r\n'),(1345,10,531,0,239,NULL),(1364,10,104,0,240,NULL),(1365,10,97,0,240,'Hippocrates, the father of medicine, had mentioned Lasuna in his medical notes . Lasuna Capsules avoids cholesterol deposition on coronary artery walls.\r\n•	Helps in Rheumatism, Arthritis, Pneumonia, Gas trouble, flatulence\r\n•	It lowers down Cholesterol and high Blood Pressure.\r\n•	Lasuna inhibits platelet aggregation.	'),(1366,10,506,0,240,'lasuna   /ALLIUM SATIVUM bulbs\r\n Allin > 1.5%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nA cholesterol regulator\r\n\r\n•	Lasuna lowers cholesterol\r\n•	helps in vasodilation\r\n'),(1367,10,531,0,240,NULL),(1380,10,104,0,241,NULL),(1381,10,97,0,241,'Trikatu contains three herbs that are beneficial for digestive ailments. The piperine in Long Pepper and Black Pepper helps digest fatty foods, and break down proteins. Black Pepper also reduces abdominal spasms and increases the absorption of nutrients. Ginger reduces the symptoms of functional dyspepsia such as abdominal pain and discomfort.\r\n•	Useful in Indigestion\r\n•	Useful in Flatulence\r\n•	Useful in Loss of appetite\r\n'),(1382,10,506,0,241,'Trikatu (Indian Long Pepper, Black Pepper & Zingiber officinale)\r\nPiperine > 2%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nDigestive Formula\r\n•	Use in Ingestion\r\n•	Flatulence\r\n•	Loss of appetite\r\n'),(1383,10,531,0,241,NULL),(1394,10,104,0,242,NULL),(1395,10,97,0,242,'Yashtimadhu is beneficial in treating acid peptic disease. It reduces gastric acid secretion and inhibits the formation of peptic ulcers.  It is also one of the world\'s most widely researched herbs for its role in supporting the body’s normal digestive function.\r\n•	Useful in Hyperacidity\r\n•	Useful in Peptic ulcer\r\n•	Useful in Gastroesophageal reflux disease(GERD)\r\n'),(1396,10,506,0,242,'Licorice/Glycyrrhiza glabra  \r\n60 Veg Capsues \r\nHerbal Supplement\r\n Glycyrrhizinic acid > 15%\r\nUseful in Acidity\r\n•	Reduces Acid secretion\r\n•	Useful in Peptic ulcer\r\n'),(1397,10,531,0,242,NULL),(1412,10,104,0,243,NULL),(1413,10,97,0,243,'Since ancient times Shankpushpi is used as a brain tonic especially for children.  It has been used for centuries in Ayurveda for rejuvenating nervous functions.\r\n- works as psycho-stimulant and tranquilizer.\r\n- is used as a brain tonic.\r\n-Promotes good sleep and brings relief in anxiety and mental fatigue.\r\n'),(1414,10,506,0,243,'Convolvulus Pluricaulis\r\n 60 Veg Capsues \r\nHerbal Supplement\r\n Bitters > 2%\r\n For Neuro care\r\n•	Neuro protective.\r\n•	Has anxiolytic / anti-depressant properties.\r\n'),(1415,10,531,0,243,NULL),(1420,10,104,0,244,NULL),(1421,10,97,0,244,'The entire Punarnava plant including the root and leaves, is known to have medicinal properties.\r\n•	Punarnava has many ethnobotanical uses. \r\n•	Punarnava works as a diuretic.  \r\n•	It also has antimicrobial, anti-inflammatory and antispasmodic properties.\r\n'),(1422,10,506,0,244,'Boerhavia diffusa\r\n Alkaloids > 0.08%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nUrinary Support\r\n•	in Urinary tract infections\r\n•	as diuretic\r\n'),(1423,10,531,0,244,NULL),(1426,10,104,0,245,NULL),(1427,10,97,0,245,'Karela (Bitter Gourd/Momordica charantia) offers a host of medicinal benefits and is a key herb in Ayurvedic medicine. Karela contains a ‘plant-insulin’ which helps in lowering blood sugar levels\r\n•	It purifies the blood & regulates blood sugar levels\r\n•	It helps in maintaining good and clear skin\r\n•	It is extremely beneficial in treating Diabetes mellitus\r\n•	prevents hepatotoxicity\r\n'),(1428,10,506,0,245,'BITTER GOURD\r\n60 Veg Capsues \r\nHerbal Supplement\r\n Bitters > 5%\r\nDaibetic care\r\n•	Helps regulate blood sugar level\r\n'),(1429,10,531,0,245,NULL),(1436,10,104,0,246,NULL),(1437,10,97,0,246,'Shallaki (Boswellia serrata) is mentioned as a pain remedy in ancient Sanskrit texts dating back thousands of years. Shallaki has Boswellic acid as one of the principal constituents in the gum resin. This is a pyrazoline derivative that supports the body\'s natural inflammation response and supports healthy joints\r\n•	Help in relieving arthritis and back pains\r\n•	Take care of all kinds of inflammation from joint pains, swelling and wounds\r\n•	Helps patients of osteoarthritis and rheumatoid arthritis\r\n'),(1438,10,506,0,246,'BOSWELLIS SERRATA\r\n Boswellic Acid > 65%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nin joint pain\r\n•	in arthritis\r\n•	reduces inflammation\r\n'),(1439,10,531,0,246,NULL),(1444,10,104,0,247,NULL),(1445,10,97,0,247,'Amla (Indian Gooseberry/Emblica officinalis ) has been revered for its medicinal benefits for more than 3,000 years It is an antioxidant with the rich natural source of Vitamin C, minerals and amino acids. It helps in protecting cells against free radical damage.\r\n•	Cough, cold, sore throat & other respiratory tract infections\r\n•	Premature Aging\r\n•	Skin disorders\r\n•	Dyspepsia & Hyperacidity'),(1446,10,506,0,247,'INDIAN GOOSEBERRY\r\n60 Veg Capsues \r\nHerbal Supplement\r\n Tannins > 25%\r\nNatural Antioxidant\r\n•	A natural vitamin C\r\n•	In premature ageing\r\n'),(1447,10,531,0,247,NULL),(1452,10,104,0,248,NULL),(1453,10,97,0,248,'AZADIRACHTA INDICA\r\n Bitters > 2.5%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nSkin Care\r\n•	to treat Acnes(Pimples)\r\n•	in Skin allergies and Infections\r\n'),(1454,10,506,0,248,'Neem has been used in the Ayurvedic tradition for thousands of years for maintaining health and overall well-being. The roots, bark, gum, leaves, fruit, seed kernels and seed oil are all used in therapeutic preparations for both internal and topical use.\r\n•	 It has anti-bacterial & anti-fungal properties\r\n•	It supports the circulatory, digestive, respiratory and urinary systems\r\n•	It is a blood purifying agent\r\n•	It helps to maintain a healthy & beautiful skin\r\n'),(1455,10,531,0,248,NULL),(1458,10,104,0,249,NULL),(1459,10,97,0,249,'Shuddha Guggulu has been used historically for centuries to support normal fat levels and metabolism. It contains resin, volatile oils and gum. The extract has ketonic steroid compounds known as guggulsterones.\r\n•	It lowers the overall cholesterol levels in the blood\r\n•	Useful in Atherosclerosis	\r\n•	It also reduces the stickiness of platelets\r\n•	It regulates metabolism and can help with weight loss. \r\n'),(1460,10,506,0,249,'COMMIPHORA MUKUL\r\n Guggalsterones > 2.5%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nlipid regulator\r\n•	reduces cholesterol\r\n•	in atherosclerosis\r\n'),(1461,10,531,0,249,NULL),(1468,10,104,0,250,NULL),(1469,10,97,0,250,'Fenugreek is used as an herb (dried or fresh leaves), spice (seeds), and vegetable (fresh leaves, sprouts, and microgreens).Traditionally Methi has been used for various disorders such as in Diabetes, high cholesterol etc. It is known to correct & maintain lipid metabolism, thereby checking weight.\r\n•	Helps to correct & maintains lipid metabolism.\r\n•	Helps maintain normal blood sugar.\r\n•	Provides support to muscles & joints.\r\n'),(1470,10,506,0,250,'Methi\r\nSaponins > 20% \r\n60 Veg Capsues \r\nHerbal Supplement\r\nDiabetic care\r\n•	maintains sugar level\r\n•	support muscles and joints\r\n'),(1471,10,531,0,250,NULL),(1474,10,104,0,251,NULL),(1475,10,97,0,251,'Turmeric may be the most effective nutritional supplement in existence.Many high quality studies show that it has major benefits for your body and brain. Curcumin is the main active ingredient in turmeric. It has powerful anti-inflammatory effects and is a very strong antioxidant.\r\n•	Helps maintain a healthy inflammatory response.\r\n•	Powerful antioxidant that can help protect cells from free radical damage.\r\n•	Has anti-inflammatory properties\r\n•	Has antimicrobial properties\r\n'),(1476,10,506,0,251,'Haldi/curcumin\r\n60 Veg Capsues \r\nHerbal Supplement\r\n Curcumin > 5%\r\nAnti-infective\r\n•	Anti microbial\r\n•	Anti inflammatory\r\n'),(1477,10,531,0,251,NULL),(1480,10,104,0,252,NULL),(1481,10,97,0,252,'Gymnema sylvestre is an herb native to the tropical forests of southern and central India and \r\nSri Lanka. Chewing the leaves suppresses the sensation of sweet.  The Hindi word Gur-mar literally means sugar destroyer.in Ayurveda ,Gurmar has been historically used to manage healthy blood sugar levels.\r\n•	Helps maintain normal blood sugar levels.\r\n•	Helps maintain healthy lipid levels.\r\n•	Aids healthy functioning of pancreatic cells.\r\n•	Promotes glucose utilization.\r\n'),(1482,10,506,0,252,'Gurmar/Meshshringi \r\n60 Veg Capsues \r\nHerbal Supplement\r\n Gymnemic acid>25%\r\nSugar metabolism\r\n•	maintains glucose level\r\n•	energy production\r\n'),(1483,10,531,0,252,NULL),(1488,10,104,0,253,NULL),(1489,10,97,0,253,'jamun, is an evergreen tropical tree. In Ayurvedic literature Jamun seeds have been mentioned to be useful in \"Prameha\" - Diabetes Mellitus. Jamun has been found useful in improving the functions of the pancreas. Astringent property of Jamun helps to bring about healthy blood sugar control and also control excessive urination in Diabetes.\r\n•	Helpful in Diabetes Management by its blood sugar controlling effects.\r\n•	Helps in proper functions of the Liver.\r\n•	Safe for Long term use along with modern medicines of Diabetes.\r\n'),(1490,10,506,0,253,' Eugenia Jambolana\r\n Saponins > 10%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nDiabetic care\r\n•	maintains sugar level\r\n•	proper liver function\r\n'),(1491,10,531,0,253,NULL),(1496,10,104,0,254,NULL),(1497,10,97,0,254,'The bark of the Arjuna tree has been used for several centuries for treating cardiovascular ailments. Its an unique herb that helps maintain a healthy heart & reduces the effects of stress and nervousness. It improves the blood circulation to the heart.\r\n\r\n•	As an adjuvant in ischemic heart disease\r\n•	Monitors triglycerides level in blood\r\n•	Regulates blood Pressure\r\n•	Effective Cardiac Function\r\n'),(1498,10,506,0,254,'(TERMINALIA ARJUNA) \r\nTannins > 25%\r\n60 Veg Capsues \r\nHerbal Supplement\r\nfor Heart Care\r\n•	Helps improves blood circulation to heart\r\n•	Maintains cholesterol level\r\n'),(1499,10,531,0,254,NULL),(1516,10,104,0,255,NULL),(1517,10,97,0,255,'Almond is a nutritionally dense food and is a rich source of vitamin E. Almonds also contain phytosterols  which have been associated with cholesterol-lowering properties.\r\n•	Nourishes the brain and nervous system \r\n•	Enhances intellectuality and endurance \r\n•	Beneficial for digestive system.\r\n•	Highly beneficial for skin\r\n•	Boosts immune system\r\n•	Reduces cholesterol\r\n•	Stablises blood sugar\r\n•	Useful in Diabetes\r\n'),(1518,10,506,0,255,'•