_viewed\" name=\"home.reports.product.viewed\" alias=\"product_viewed\" template=\"reports/home_product_viewed.phtml\" after=\"product_new\"><action method=\"addPriceBlockType\"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\r\n<block type=\"reports/product_compared\" name=\"home.reports.product.compared\" template=\"reports/home_product_compared.phtml\" after=\"product_viewed\"><action method=\"addPriceBlockType\"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\r\n</reference><reference name=\"right\">\r\n<action method=\"unsetChild\"><alias>right.reports.product.viewed</alias></action>\r\n<action method=\"unsetChild\"><alias>right.reports.product.compared</alias></action>\r\n</reference>-->','','',NULL,NULL,NULL),(3,'About  Us','one_column',NULL,NULL,'about-us',NULL,'<p><strong>VISION</strong></p>\r\n<p>To have a diversified portfolio of Lifecare products which are best in quality.</p>\r\n<p><strong>MISSION</strong></p>\r\n<p>To serve our customers globally and ensure product availability at various location.</p>\r\n<p><strong>ABOUT US</strong></p>\r\n<p style=\"text-align: justify;\">Gifting Health aspires to be a leading global retailer of lifecare products &ndash; including nutrition, vitamins, minerals, herbal, ayurvedic, essential oils and devices. It has a portfolio of 51 products and intends to be reach a magical 111 products by year end.</p>\r\n<p><strong>HISTORY</strong></p>\r\n<p style=\"text-align: justify;\">It all started in Dec 2014 with my search of quality nutrition products which can provide me with my daily requirements of Proteins and Vitamins.I was preparing for State Archery competition and needed strength and energy to compete with the best.Its not easy for one, who is aged 44 to compete with youngsters at their peak.My search confused me more as the nutrition market in India was mostly depended on Imported supplements whose genuinity was always a question as retailers often refused to give an Invoice.And if have found a reliable source, the availability was not assured.</p>\r\n<p style=\"text-align: justify;\">Keeping good Health is a Habit. All fitness enthusiasts will agree with me that your daily dose of Vitamins and Supplements is as important as your exercise.And if there is a break in any of the two it disturbs you.It took one such disturbance which made me take a decision to open a Multi brand Supplement store , Orbit Health store, which would not only meet my requirement of quality and genuine supplements but also of other health lovers. It was a big diversion for a person who had been education business for past 17 years.</p>\r\n<p style=\"text-align: justify;\">While persuing my Pharmacy at BITS, Pilani, I had dreamt of having my own Pharma company one day.I even worked in TOP INDIAN and MNC companies for few years to get the necessary business acumen and technical expertise.But I diversified in IT in 1997 and have done remarkably well in career.Having tasted success and recognition in the new supplement Store, I once again stated dreaming about my own Pharma company.It could not be at a better time than this.There is an increasing demand for quality nutrition from Sportspersons, general public and Patients.All they need is an affordable cost with assurance of continuous supply.With more and more people preferring to buy online, it also gave an opportunity to make by products available to people around the world just at the click of a button.</p>\r\n<p style=\"text-align: justify;\">This was the stimulus for me to start \"Gifting Health\", which will deal in Nutrition, Beauty and Personal care products to start with.I have selected a team with 90% of them from Health Sciences and rest from management background.Gifting Health will offer you the best of products.We also provide Personal Counseling to customers looking for Fitness and Diet Charts.We want to encourage more and more people to take up fitness as a routine and go for Balanced nutrition.</p>\r\n<p><strong>BUSINESS MODEL</strong></p>\r\n<p style=\"text-align: justify;\">Gifting Health has diversified business model for product sales &ndash; company owned retail stores, e-commerce (market places as well as own portal), modern trade outlets, dealer network, corporate tie-ups, ethical promotion to doctors and exports.The products are manufactured at own licensed premises or third party contract manufacturers adhering to strict quality practices.</p>\r\n<p><strong>CERTIFICATION</strong></p>\r\n<p>FSSAI, MSME<br />RECOGNITION</p>\r\n<p>Olympic and National sportspersons <br />Critical care patients<br />Health conscious individuals<br />Fitness trainer <br />Dieticians &amp; Nutritionists<br />Doctors</p>\r\n<p><strong>TURNOVER</strong></p>\r\n<p>We have a turnover of Rs. One million in the current financial year.</p>','2007-08-30 11:31:41','2015-06-09 11:58:26',1,0,'<reference name=\"head\">\r\n<action method=\"addCss\">\r\n<stylesheet>css/myCustom.css</stylesheet>\r\n</action>\r\n</reference>\r\n',NULL,NULL,NULL,NULL,NULL),(4,'customer service','three_columns',NULL,NULL,'customer-support',NULL,'<div class=\"title_text\">\r\n<div class=\"page-head\">\r\n<p><strong>Customer Service</strong></p>\r\n</div>\r\n<ul>\r\n<li><a href=\"#answer1\">Shipping &amp; Delivery</a></li>\r\n<li><a href=\"#answer2\">Privacy &amp; Security</a></li>\r\n<li><a href=\"#answer3\">Returns &amp; Replacements</a></li>\r\n<li><a href=\"#answer4\">Ordering</a></li>\r\n<li><a href=\"#answer5\">Payment, Pricing &amp; Promotions</a></li>\r\n<li><a href=\"#answer6\">Viewing Orders</a></li>\r\n<li><a href=\"#answer7\">Updating Account Information</a></li>\r\n</ul>\r\n<p><strong>Shipping &amp; Delivery</strong></p>\r\n<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit. Mauris pulvinar erat non massa. Suspe