nditions listed below. All products/services and information displayed on giftinghealth.in constitute an \"invitation to offer\". Your order for purchase constitutes your \"offer\" which shall be subject to the terms and conditions as listed below giftinghealth.in reserves the right to accept or reject your offer. If you have supplied us with your email address, we will notify you by email as soon as possible to confirm receipt of your order and email you again to confirm details and thereafter process the order. Our acceptance of your order will take place upon dispatch of the product(s) ordered. No act or omission of giftinghealth.in prior to the actual dispatch of the product (s) ordered will constitute acceptance of your offer.</p>\r\n<p><strong>&nbsp;Membership Eligibility</strong></p>\r\n<p style=\"text-align: justify;\">Use of the Site is available only to persons who can form legally binding contracts under applicable law. Persons who are \"incompetent to contract\" within the meaning of the Indian Contract Act, 1872 including un-discharged insolvents etc. are not eligible to use the Site. If you are a minor i.e. under the age of 18 years but at least 13 years of age you may use this Site only under the supervision of a parent or legal guardian who agrees to be bound by these Terms of Use. If your age is below that of 18 years your parents or legal guardians can transact on behalf of you if they are registered users. You are prohibited from purchasing any material which is for adult consumption, the sale or purchase of which to/by minors are strictly prohibited. giftinghealth.in reserves the right to terminate your membership and refuse to provide you with access to the Site if giftinghealth.in discovers that you are under the age of 18 years. The Site is not available to persons whose membership has been suspended or terminated by giftinghealth.in for any reason whatsoever. If you are registering as a business entity, you represent that you have the authority to bind the entity to this User Agreement. Unless otherwise specified, the materials on this website are directed solely at those who access this website from India. giftinghealth.in makes no representation that any products or services referred to in the materials on this website are appropriate for use, or available outside India. Those who choose to access this Site from outside India are responsible for compliance with local laws if and to the extent local laws are applicable. giftinghealth.in will deliver the products only within India and will not be liable for any claims relating to any products ordered from outside India. Except where additional terms and conditions are provided which are product specific, these terms and conditions supersede all previous representations, understandings, or agreements and shall prevail notwithstanding any variance with any other terms of any order submitted. By using the services of giftinghealth.in you agree to be bound by the Terms and Conditions.</p>\r\n<p><strong>&nbsp;Account and Registration Obligations</strong></p>\r\n<p style=\"text-align: justify;\">&ldquo;Your Information\" is defined as any information you provide to us in the registration, buying or listing process, in the feedback area or through any e-mail feature. We will protect Your Information in accordance with our Privacy Policy. If you use the Site, you are responsible for maintaining the confidentiality of your account and Password and for restricting access to your computer, and you agree to accept responsibility for all activities that occur under your account or Password. giftinghealth.in shall not be liable to any person for any loss or damage which may arise as a result of any failure by you to protect your password or account. If you know or suspect that someone else knows your password you should notify us by contacting us immediately through the address provided below. If giftinghealth.in has reason to believe that there is likely to be a breach of security or misuse of the giftinghealth.in Site, we may require you to change your password or we may suspend your account without any liability to giftinghealth.in You also agree to: 1: Provide true, accurate, current and complete information about yourself as prompted by giftinghealth.in\'s registration form (such information being the \"Registration Data\") 2: Maintain and promptly update the Registration Data to keep it true, accurate, current and complete. If you provide any information that is untrue, inaccurate, incomplete, or not current or if giftinghealth.in has reasonable grounds to suspect that such information is untrue, inaccurate, not current or not in accordance with the User Agreement, giftinghealth.in has the right to indefinitely suspend or terminate your membership and refuse to provide you with access to the Site.</p>\r\n<p><strong>&nbsp;Pricing Information</strong></p>\r\n<p style=\"text-align: justify;\">While giftinghealth.in strives to provide accurate product and pricing information, pricing or typographical errors may occur giftinghealth.in cannot confirm the price of a product until after you order. In the event that a product is listed at an incorrect price or with incorrect information due to an error in pricing or product information, giftinghealth.in shall have the right, at our sole discretion, to refuse or cancel any orders placed for that product, unless the product has already been dispatched. In the event that an item is mis-priced, giftinghealth.in may, at its discretion, either contact you for instructions or cancel your order and notify you of such cancellation. Unless the product ordered by you has been dispatched, your offer will not be deemed accepted and giftinghealth.in will have the right to modify the price of the product and contact you for further instructions using the e-mail address provided by you during the time of registration, or cancel the order and notify you of such cancellation. In the event that giftinghealth.in accepts your order the same shall be debited to your credit card account and duly notified to you by email that the payment has been processed. The payment may be processed prior to giftinghealth.in dispatch of the product that you have ordered. If we have to cancel the order after we have processed the payment, the said amount will be reversed back to your bank account.</p>\r\n<p style=\"text-align: justify;\">We strive to provide you with the lowest prices possible on giftinghealth.in. However, sometimes a price online does not match the price in the market. In our effort to be the lowest price provider in your particular geographic region, Market price will sometimes differ from online prices. Prices and availability are subject to change without notice.</p>\r\n<p style=\"text-align: justify;\"><strong>Cancellation by giftinghealth.in</strong></p>\r\n<p style=\"text-align: justify;\">Please note that there may be certain orders that we are unable to accept and must cancel. We reserve the right, at our sole discretion, to refuse or cancel any order for any reason. Some situations that may result in your order being cancelled include limitations on quantities available for purchase, inaccuracies or errors in product or pricing information, or problems identified by our credit and fraud avoidance department. We may also require additional verifications or information before accepting any order. We will contact you if all or any portion of your order is canceled or if additional information is required to accept your order. If your order is cancelled after your Credit/Debit card has been charged, the said amount will be reversed back in your Card Account.</p>\r\n<p><strong>Cancellation by the customer</strong></p>\r\n<p>Once the product has been ordered by the customer and has been dispatched from our side, there will be no cancellation of the order or refund.</p>\r\n<p><strong>Modification of Terms and conditions of Service</strong>&nbsp;</p>\r\n<p><strong>Governing Law and Jurisdiction</strong></p>\r\n<p style=\"text-align: justify;\">This User Agreement shall be construed in accordance with the applicable laws of India. The Courts at Hyderabad shall have exclusive jurisdiction in any proceedings arising out of this agreement. Any dispute or difference either in interpretation or otherwise, of any terms of this User Agreement between the parties hereto, the same shall be referred to an independent arbitrator who will be appointed by giftinghealth.in and his decision shall be final and binding on the parties hereto. The above arbitration shall be in accordance with the Arbitration and Conciliation Act, 1996 as amended from time to time. The arbitration shall be held in Hyderabad The High Court of judicature at Hyderabad alone shall have the jurisdiction and the Laws of India shall apply.&nbsp;</p>\r\n<p style=\"text-align: justify;\">All reviews, comments, feedback, postcards, suggestions, ideas, and other submissions disclosed, submitted or offered to giftinghealth.in on or by this Site or otherwise disclosed, submitted or offered in connection with your use of this Site (collectively, the \"Comments\") shall be and remain giftinghealth.in property. Such disclosure, submission or offer of any Comments shall constitute an assignment to giftinghealth.in of all worldwide rights, titles and interests in all copyrights and other intellectual properties in the Comments. Thus, giftinghealth.in owns exclusively all such rights, titles and interests and shall not be limited in any way in its use, commercial or otherwise, of any Comments. giftinghealth.in will be entitled to use, reproduce, disclose, modify, adapt, create derivative works from, publish, display and distribute any Comments you submit for any purpose whatsoever, without restriction and without compensating you in any way. giftinghealth.in is and shall be under no obligation (1) to maintain any Comments in confidence; (2) to pay you any compensation for any Comments; or (3) to respond to any Comments. You agree that any Comments submitted by you to the Site will not violate this policy or any right of any third party, including copyright, trademark, privacy or other personal or proprietary right(s), and will not cause injury to any person or entity. You further agree that no Comments submitted by you to the Site will be or contain libelous or otherwise unlawful, threatening, abusive or obscene material, or contain software viruses, political campaigning, commercial solicitation, chain letters, mass mailings or any form of \"spam\".</p>\r\n<p><strong>Copyright &amp; Trademark</strong></p>\r\n<p style=\"text-align: justify;\">The giftinghealth.in names and logos and all related product and service names, design marks and slogans are the trademarks or service marks of giftinghealth.in. All other marks are the property of their respective companies. No trademark or service mark license is granted in connection with the materials contained on this Site. Access to this Site does not authorize anyone to use any name, logo or mark in any manner. References on this Site to any names, marks, products or services of third parties or hypertext links to third party sites or information are provided solely as a convenience to you and do not in any way constitute or imply giftinghealth.in endorsement, sponsorship or recommendation of the third party, information, product or service.</p>\r\n<p style=\"text-align: justify;\">All materials, including images, text, illustrations, designs, icons, photographs, programs, music clips or downloads, video clips and written and other materials that are part of this Site (collectively, the \"Contents\") are intended solely for personal, non-commercial use. You may download or copy the Contents and other downloadable materials displayed on the Site for your personal use only. No right, title or interest in any downloaded materials or software is transferred to you as a result of any such downloadi