d assigns from and against any and all claims, liabilities, damages, losses, costs and expenses, including attorney\'s fees, caused by or arising out of claims based upon your actions or inactions, which may result in any loss or liability to giftinghealth.in or any third party including but not limited to breach of any warranties, representations or undertakings or in relation to the non-fulfillment of any of your obligations under this User Agreement or arising out of the your violation of any applicable laws, regulations including but not limited to Intellectual Property Rights, payment of statutory dues and taxes, claim of libel, defamation, violation of rights of privacy or publicity, loss of service by other subscribers and infringement of intellectual property or other rights. This clause shall survive the expiry or termination of this User Agreement.</p>\r\n<p><strong>Termination</strong></p>\r\n<p style=\"text-align: justify;\">This User Agreement is effective unless and until terminated by either you or giftinghealth.in. You may terminate this User Agreement at any time, provided that you discontinue any further use of this Site. giftinghealth.in may terminate this User Agreement at any time and may do so immediately without notice, and accordingly deny you access to the Site, Such termination will be without any liability to giftinghealth.in. Upon any termination of the User Agreement by either you or giftinghealth.in, you must promptly destroy all materials downloaded or otherwise obtained from this Site, as well as all copies of such materials, whether made under the User Agreement or otherwise. giftinghealth.in&rsquo;s right to any Comments shall survive any termination of this User Agreement. Any such termination of the User Agreement shall not cancel your obligation to pay for the product already ordered from the Site or affect any liability that may have arisen under the User Agreement.&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n</