 Providers is solely for your personal, non-commercial use. You may print a copy of the content and/or information contained herein for your personal, non-commercial use only, but you may not copy, reproduce, republish, upload, post, transmit, distribute, and/or exploit the content or information in any way (including by e-mail or other electronic means) for commercial use without the prior written consent of giftinghealth.in or the Providers.</p>\r\n<p>Without the prior written consent of giftinghealth.in or the Providers, your modification of the content, use of the content on any other web site or networked computer environment, or use of the content for any purpose other than personal, non-commercial use, violates the rights of the owners giftinghealth.in and/or the Provider copyrights, trademarks or service marks and other proprietary rights, and is prohibited. As a condition to your use of this Web Site, you warrant to giftinghealth.in that you will not use our Web Site for any purpose that is unlawful or prohibited by these Terms, or transmitting any threatening, libelous, defamatory, obscene, scandalous, inflammatory, or profane material. If you violate any of these Terms, your permission to use our Web Site immediately terminates without the necessity of any notice. giftinghealth.in retains the right to deny access to anyone at its discretion for any reason, including for violation of these Terms. You may not use on your web site any trademarks, service marks or copyrighted materials appearing on this Web Site, including but not limited to any logos or characters, without the express written consent of the owner of the mark or copyright. You may not frame or otherwise incorporate into another web site any of the content or other materials on this Web Site without prior written consent of giftinghealth.in</p>\r\n<p><strong>Your Accounts<br /></strong></p>\r\n<p>If you use this site, you are responsible for maintaining the confidentiality of your account and 