tation, advertising or dealing in any products or services or transmit any chain letters or junk mails.</p>\r\n<p>You will not post or transmit any content, information or trademarks without the prior consent of the person holding its proprietary or licensed rights. giftinghealth.in will not in any way be responsible or answerable to any action brought by any person arising out of your acts as described above.</p>\r\n</div>','2014-12-10 14:00:46','2015-06-09 13:00:47',1,0,'<reference name=\"head\">\r\n<action method=\"addCss\">\r\n<stylesheet>css/myCustom.css</stylesheet>\r\n</action>\r\n</reference>',NULL,NULL,NULL,NULL,NULL),(18,'Disclaimer','one_column',NULL,NULL,'disclaimer','Disclaimer','<div class=\"title_text\">\r\n<p><strong>Limitation of Liability and Disclaimers</strong></p>\r\n<p style=\"text-align: justify;\">The Site is provided without any warranties or guarantees and in an &ldquo;As Is&rdquo; condition. You must bear the risks associated with the use of the Site. The Site provides content from other Internet sites or resources and while <a title=\"www.giftinghealth.in\" href=\"http://www.giftinghealth.in\" target=\"_blank\">giftinghealth.in</a> tries to ensure that material included on the Site is correct, reputable and of high quality, it cannot accept responsibility if this is not the case. <a title=\"www.giftinghealth.in\" href=\"http://www.giftinghealth.in\" target=\"_blank\">giftinghealth.in</a> will not be responsible for any errors or omissions or for the results obtained from the use of such information or for any technical problems you may experience with the Site.This disclaimer does not apply to any product warranty offered by the manufacturer of the product as specified in the product specifications. This disclaimer constitutes an essential part of this User Agreement. To the fullest extent permitted under applicable law, giftinghealth.in or its suppliers shall not be liable for any indirect, incidental, special, incidental, consequential 