mal delay in our execution of the order - i.e. more than 15 days.</p>\r\n<p><strong>PLEASE NOTE: Along with the other terms and conditions these additional terms are applicable in case you have bought any products not manufactured by giftinghealth.in and its group companies. In other words these additional terms and conditions are applicable in case you buy products sold on giftinghealth.in by third party vendors. </strong></p>\r\n<p>You understand and agree that there may be certain products, which will be sold on the Site by third party vendors (&ldquo;Vendors&rdquo;). giftinghealth.in may not be able to control the transactions or the acts and omissions of the Vendors in such transactions. When you buy such products from Vendors on the Site the following additional terms and conditions will become applicable:</p>\r\n<p>You release and indemnify giftinghealth.in and/or any of its officers and representatives from any cost, damage, liability or other consequence of any of the actions of the Vendors on the Site and specifically waive any claims that you may have in this behalf under any applicable law. Notwithstanding its reasonable efforts in that behalf, giftinghealth.in cannot control the information provided by other Vendors, which is made available on the Site. You may find other Vendor&rsquo;s information to be offensive, harmful, inaccurate, or deceptive. Please use caution, and practice safe trading when using the Site. Please note that there are also risks of dealing with foreign nationals, underage persons or people acting under false pretense.</p>\r\n<p>All other terms and conditions of this User Agreement are applicable to such transactions.</p>\r\n<p>Bank Payment Details</p>\r\n<p>You agree, understand and confirm that the Credit/Debit card details provided by you for availing of services on giftinghealth.in will be correct and accurate and you shall not use the credit card which is not lawfully owned by you. I.e. in a Debit/Credit card transaction, you must use your own card. You further agree and undertake to provide the correct and valid card details to giftinghealth.in. Further the said information will not be utilized and shared by giftinghealth.in with any of the third parties unless required by law, regulation or court order. giftinghealth.in will not be liable for any Credit/Debit card fraud. The liability for use of a card fraudulently will be on you and the onus to \'prove otherwise\' shall be exclusively on you.</p>\r\n<p>Fraudulent / Declined Transactions</p>\r\n<p>When you visit the Site or send emails to us, you are communicating with us electronically. You consent to receive communications from us electronically. We will communicate with you by calls / email or by posting notices on the Site. You agree that all agreements, notices, disclosures and other communications that we provide to you electronically satisfy any legal requirement that such communications be in writing.</p>\r\n<p>That in the event that a non-delivery occurs on account of a mistake by you (i.e. wrong name or address or any other wrong information) any extra cost incurred by giftinghealth.in for redelivery shall be claimed from you.</p>\r\n<p>That you will use the services provided by giftinghealth.in, its affiliates, consultants and contracted companies, for lawful purposes only and comply with all applicable laws and regulations while using the Site and transacting on the Site.</p>\r\n<p>You will provide authentic and true information in all instances where such information is requested of you. giftinghealth.in reserves the right to confirm and validate the information and other details provided by you at any point of time. If upon confirmation your details are found not to be true (wholly or partly), giftinghealth.in has the right in its sole discretion to reject the registration and debar you from using the Services of giftinghealth.in and / or other affiliated websites without prior intimation whatsoever.</p>\r\n<p>That you a