th;\">&nbsp;</div>\r\n</div>\r\n<!--\r\n<div id=\"money_back_100_3\" class=\"delivery_brg_b\">\r\n<div class=\"grid_9 alpha\"><img style=\"height: 136px; width: 409px;\" src=\"{{skin url=\'images/guarantedd-100.png\'}}\" alt=\"\" /></div>\r\n<div class=\"delivery_mar_t grid_13\">\r\n<p>We seldom see this happening. But in case you intend to, you may return or replace any product within 10 days according to our cancellations &amp; returns policy and we will refund your money in no time.</p>\r\n</div>\r\n<div style=\"clear: both;\">&nbsp;</div>\r\n</div>--></div>','2014-12-26 09:11:50','2015-05-05 07:28:15',1,0,'<reference name=\"head\">\r\n<action method=\"addCss\">\r\n<stylesheet>css/myCustom.css</stylesheet>\r\n</action>\r\n</reference>',NULL,NULL,NULL,NULL,NULL);

/*Table structure for table `cms_page_store` */

DROP TABLE IF EXISTS `cms_page_store`;

CREATE TABLE `cms_page_store` (
  `page_id` smallint(6) NOT NULL COMMENT 'Page ID',
  `store_id` smallint(5) unsigned NOT NULL COMMENT 'Store ID',
  PRIMARY KEY (`page_id`,`store_id`),
  KEY `IDX_CMS_PAGE_STORE_STORE_ID` (`store_id`),
  CONSTRAINT `FK_CMS_PAGE_STORE_PAGE_ID_CMS_PAGE_PAGE_ID` FOREIGN KEY (`page_id`) REFERENCES `cms_page` (`page_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_CMS_PAGE_STORE_STORE_ID_CORE_STORE_STORE_ID` FOREIGN KEY (`store_id`) REFERENCES `core_store` (`store_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='CMS Page To Store Linkage Table';

