/*Table structure for table `core_email_template` */

DROP TABLE IF EXISTS `core_email_template`;

CREATE TABLE `core_email_template` (
  `template_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Template Id',
  `template_code` varchar(150) NOT NULL COMMENT 'Template Name',
  `template_text` text NOT NULL COMMENT 'Template Content',
  `template_styles` text COMMENT 'Templste Styles',
  `template_type` int(10) unsigned DEFAULT NULL COMMENT 'Template Type',
  `template_subject` varchar(200) NOT NULL COMMENT 'Template Subject',
  `template_sender_name` varchar(200) DEFAULT NULL COMMENT 'Template Sender Name',
  `template_sender_email` varchar(200) DEFAULT NULL COMMENT 'Template Sender Email',
  `added_at` timestamp NULL DEFAULT NULL COMMENT 'Date of Template Creation',
  `modified_at` timestamp NULL DEFAULT NULL COMMENT 'Date of Template Modification',
  `orig_template_code` varchar(200) DEFAULT NULL COMMENT 'Original Template Code',
  `orig_template_variables` text COMMENT 'Original Template Variables',
  PRIMARY KEY (`template_id`),
  UNIQUE KEY `UNQ_CORE_EMAIL_TEMPLATE_TEMPLATE_CODE` (`template_code`),
  KEY `IDX_CORE_EMAIL_TEMPLATE_ADDED_AT` (`added_at`),
  KEY `IDX_CORE_EMAIL_TEMPLATE_MODIFIED_AT` (`modified_at`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='Email Templates';

/*Data for the table `core_email_template` */

insert  into `core_email_template`(`template_id`,`template_code`,`template_text`,`template_styles`,`template_type`,`template_subject`,`template_sender_name`,`template_sender_email`,`added_at`,`modified_at`,`orig_template_code`,`orig_template_variables`) values (1,'Order','<body style=\"background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;\">\r\n<div style=\"background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;\">\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"100%\">\r\n<tr>\r\n    <td align=\"center\" valign=\"top\" style=\"padding:20px 0 20px 0\">\r\n        <table bgcolor=\"#FFFFFF\" cellspacing=\"0\" cellpadding=\"10\" border=\"0\" width=\"650\" style=\"border:1px solid #E0E0E0;\">\r\n            <!-- [ header starts here] -->\r\n            <tr>\r\n                <td valign=\"top\" style=\"background-color:#003e6d\"><a href=\"{{store url=\"\"}}\"><img src=\"{{var logo_url}}\" alt=\"{{var logo_alt}}\" style=\"margin-bottom:10px;\" border=\"0\"/></a></td>\r\n            </tr>\r\n            <!-- [ middle starts here] -->\r\n            <tr>\r\n                <td valign=\"top\">\r\n                    <h1 style=\"font-size:12px; font-weight:normal; line-height:12px; margin:0 0 11px 0;\"\">Hello, {{htmlescape var=$order.getCustomerName()}}</h1>\r\n                    <p style=\"font-size:12px; line-height:16px; margin:0;\">\r\n                        Thank you for your order from {{var store.getFrontendName()}}.\r\n                        Once your package ships we will send an email with a link to track your order.\r\n                        You can check the status of your order by <a href=\"{{store url=\"customer/account/\"}}\" style=\"color:#010101;\">logging into your account</a>.\r\n                        If you have any questions about your order please contact us at <a href=\"mailto:{{config path=\'trans_email/ident_support/email\'}}\" style=\"color:#d40000;\">{{config path=\'trans_email/ident_support/email\'}}</a> or call us at <span class=\"nobr\">{{config path=\'general/store_information/phone\'}}</span> Monday - Friday, 8am - 5pm PST.\r\n                    </p>\r\n                    <p style=\"font-size:12px; line-height:16px; margin:0;\">Your order confirmation is below. Thank you again for your business.</p>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <h2 style=\"font-size:12px; font-weight:normal; margin:0;color:#010101\">Your Order #{{var order.increment_id}} <small style=\"color:#7f7f7f; font-size:12px;\">(placed on {{var order.getCreatedAtFormated(\'long\')}})</small></h2>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"650\">\r\n                        <thead>\r\n                        <tr>\r\n                            <th align=\"left\" width=\"325\" style=\"font-size:14px; padding:5px 0px 6px 0px; line-height:1em;color:#1b1b1b\">Billing Information:</th>\r\n                            <th width=\"10\"></th>\r\n                            <th align=\"left\" width=\"325\" style=\"font-size:14px; padding:5px 0px 6px 0px; line-height:1em;color:#1b1b1b\">Payment Method:</th>\r\n                        </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                        <tr>\r\n                            <td valign=\"top\" style=\"font-size:12px; padding:7px 0px 9px 0px;\">\r\n                                {{var order.getBillingAddress().format(\'html\')}}\r\n                            </td>\r\n                            <td>&nbsp;</td>\r\n                            <td valign=\"top\" style=\"font-size:12px; padding:7px 0px 9px 0px;\">\r\n                                {{var payment_html}}\r\n                            </td>\r\n                        </tr>\r\n     